import idefault from "./images/idefault.jpg";
import iestrella from "./images/iestrella.jpg";
import ijerez from "./images/ijerez.jpg";
import imoclin from "./images/imoclin.jpg";
import imulhacen from "./images/imulhacen.jpg";

const Images = [
    { id: 1, src: 'iestrella.jpg', title: 'iestrella', description: 'iestrella' },
    { id: 2, src: 'ijerez.jpg', title: 'ijerez', description: 'ijerez' },
    { id: 3, src: 'imoclin.jpg', title: 'imoclin', description: 'imoclin' },
    { id: 4, src: 'imulhacen.jpg', title: 'imulhacen', description: 'imulhacen' },
    { id: 5, src: 'idefault.jpg', title: 'idefault', description: 'idefault' },

  ];

  function getImageByKey(key : string){
    return Images[key];
  }

  export default Images;
